import React from 'react';

function NewGoal(props) {
    const eventHandler = (e) => {
        e.preventDefault();

        const goalAdd = {
            id: Math.random(),
            text: 'welcome'
        }
        console.log(goalAdd)
    }
    return (
        <div>
            <input type="text" onSubmit={eventHandler} />
            <button type='submit'>Add Goal</button>
        </div>
    );
}

export default NewGoal;
